import styled from "styled-components";

const BtnNext = styled.button`
width: 6rem;
height: 2rem;
position:absolute;
left:65vw;
top:93vh;
border-radius: 0.5rem;
border:none;
outllin
margin-top:1rem;
`;

export default BtnNext;
